import React from "react";

const Mainheader = () => {
  return (
    <nav>
      <ul>
        <li>
            <a href="welcome">Welcome</a>
        </li>
        <li>
            <a href="/product">Products</a>
        </li>
      </ul>
    </nav>
  );
};

export default Mainheader;
